static void xp3filter_decode_c_emp(BYTE *buf, DWORD len, DWORD offset)
{
	DWORD k = (offset + 48) % 1024;

	for (DWORD i = offset; i < offset + len; ++i) {
		buf[i] ^= c_emp_decode_table[k++];
		if (k >= 1024)
			k = 0;
	}
}

