static u8 chower_decode_table2[16] = {
	0x61, 0x95, 0xDF, 0x26, 0xFF, 0x94, 0x83, 0xFA, 
	0x4E, 0xF1, 0x7A, 0x83, 0x25, 0xB2, 0xDB, 0xFC
};

static void xp3filter_decode_chower2(TCHAR *name, BYTE *buf, DWORD len, DWORD offset, DWORD hash)
{
	if (!_tcsicmp(name, _T("plugin/btext.dll")) 
			|| !_tcsicmp(name, _T("startup.tjs")) 
			|| !_tcsicmp(name, _T("system/aofcdg_initialize.tjs")))
		return;

	u16 pos = (u16)offset;

	for (DWORD i = offset; i < offset + len; ++i) {
		u32 v1 = chower_decode_table1[pos / 8];
		u32 v2 = hash ^ v1;	
		v1 >>= ((pos & 7) << 2);			
		v2 >>= (pos & 3) << 3;
		buf[i] ^= (u8)v2 ^ chower_decode_table2[v1 & 0xf];
		++pos;
	}
}

static void xp3filter_decode_himesyo(WCHAR *resource_path, BYTE *buf, DWORD len, 
									 DWORD offset, DWORD hash)
{
	WCHAR *_ext = PathFindExtension(resource_path);

	if (wcsstr(_ext, L".dll") || !wcsicmp(resource_path, L"startup.tjs"))
		return;

	DWORD dec_len;
	if (!wcsstr(L".asd.tjs.ks", _ext)) {
		if (offset >= 256)
			return;

		dec_len = 256 - offset;
	} else
		dec_len = len;

	hash = ~(hash ^ 0x03020100);
	for (DWORD i = offset; i < offset + dec_len; ) {
		u8 key = i & ~3;

		for (DWORD j = i & 3; (j < 4) && (i < offset + dec_len); ++j, ++i)
			buf[i] ^= ((u8 *)&hash)[j] ^ key;
	}
}

