void xp3filter_decode_dec(struct xp3filter *xp3filter)
{
	const char *dec_string = xp3filter->parameter;

	if (!strcmpi(dec_string, "papicon"))
		xp3filter_decode_papicon(xp3filter->resource_name, xp3filter->buffer, xp3filter->length, xp3filter->offset, xp3filter->hash);
	else if (!strcmpi(dec_string, "c_emp"))
		xp3filter_decode_c_emp(xp3filter->buffer, xp3filter->length, xp3filter->offset);
	else if (!strcmpi(dec_string, "chower2"))
		xp3filter_decode_chower2(xp3filter->resource_name, xp3filter->buffer, xp3filter->length, xp3filter->offset, xp3filter->hash);
	else if (!strcmpi(dec_string, "love"))
		xp3filter_decode_love(xp3filter->resource_name, xp3filter->buffer, xp3filter->length, xp3filter->offset, xp3filter->total_length, xp3filter->hash);		
	else if (!strcmpi(dec_string, "himesyo"))
		xp3filter_decode_himesyo(xp3filter->resource_name, xp3filter->buffer, xp3filter->length, xp3filter->offset, xp3filter->hash);
	else if (!strcmpi(dec_string, "xror"))
		xp3filter_decode_xor_ror(xp3filter->buffer, xp3filter->length, xp3filter->offset, xp3filter->hash);
	else if (!strcmpi(dec_string, "nxorn"))
		xp3filter_decode_not_xor_not(xp3filter->buffer, xp3filter->length, xp3filter->offset, xp3filter->hash);
	else if (!strcmpi(dec_string, "ixorn"))
		xp3filter_decode_inc_xor_not(xp3filter->buffer, xp3filter->length, xp3filter->offset, xp3filter->hash);
	else if (!strcmpi(dec_string, "xorinc"))
		xp3filter_decode_xor_inc(xp3filter->buffer, xp3filter->length, xp3filter->offset, xp3filter->hash);
	else if (!strcmpi(dec_string, "rsftrx"))
		xp3filter_decode_rem_shiftr_xor(xp3filter->buffer, xp3filter->length, xp3filter->offset, xp3filter->hash);
	else if (!strcmpi(dec_string, "sftrx"))
		xp3filter_decode_shiftr_xor(xp3filter->buffer, xp3filter->length, xp3filter->offset, xp3filter->hash);
	else if (!strcmpi(dec_string, "segxor"))
		xp3filter_decode_segment_xor(xp3filter->buffer, xp3filter->length, xp3filter->offset, xp3filter->hash);
	else if (!strcmpi(dec_string, "segdec"))
		xp3filter_decode_segment_decoder(xp3filter->buffer, xp3filter->length, xp3filter->offset, xp3filter->hash);
	else if (!xp3filter->length && (xp3filter->offset == xp3filter->total_length)) {	// post decode
		if (!strcmpi(dec_string, "FSN"))
			xp3filter_post_decode_Fate_Stay_Night(xp3filter->buffer, xp3filter->total_length);
		else if (!strcmpi(dec_string, "MIZUKAKE"))
			xp3filter_post_decode_MIZUKAKE(xp3filter->buffer, xp3filter->total_length);
		else if (!strcmpi(dec_string, "sufxor"))
			xp3filter_post_decode_suffix_xor(xp3filter->resource_name, xp3filter->buffer, xp3filter->total_length);
	}
}